def strlen(string: str) -> int:
    """ Return length of given string
    >>> strlen('')
    0
    >>> strlen('abc')
    3
    """
    if not string:
        return 0

    length = 0
    for char in string:
        if char.isalpha() or char.isdigit() or char.ispunct():
            length += 1
        else:
            break

    return length
